    display:flex;
    justify-content:space-between;
    align-items:center;
`;

const BtnContainer = styled.div`
    border:1px solid black;
    width:30%;
    height:100%;

    display:flex;
    align-items:center;
`;

const PageDotContainer = styled.div`
    border:1px solid black;
    width:30%;
    height:100%;
`;

const ContentInfoBar = () => {
    return(
        <BarIcons>
            <BtnContainer>
                this is a button
            </BtnContainer>
            <PageDotContainer>
            this is a bar;
            this is a bar;
            </PageDotContainer>
        </BarIcons>
    );
};

export default ContentInfoBar;
